@nyxturna is run and operated by creatrix Fay Nowitz (she/her), a Portland based interdisciplinary artist, photographer and designer. Her work focuses on the intersections of magick, fantasy, ritual, and armor.
She hand crafts mystic inspired jewelry and adornments for your altar, home, and body, as well as dreamy photography to adorn your walls. 
You can find Nyxturna at the the Kink Market this Sunday with her collections of fetish and dreamy celestial inspired jewels.
